const setUser = (state , action) => {

    switch(action.type) {
        case 'SET_USER':
            var rep = {
                ...state,
                user: action.payload.user
            }
            console.log("Received by user reducer : "+JSON.stringify(rep));
            return rep;

        default: 
            console.log("Returning by default : "+state);
            return state;
    }

}

export default setUser;
